svg.script:
var EsKlar = document.getElementById("EsKlar");
var BKlar = document.getElementById("BKlar");
var AKlar = document.getElementById("AKlar");

var c1 = document.getElementById("c1");
var es1 = document.getElementById("es1");
var kleinesB = document.getElementById("kleinesB");
var kleinesA = document.getElementById("kleinesA");

var Klang = document.getElementById("Klang");
var Klang_C = document.getElementById("Klang_C");

function addEventListeners() {
    EsKlar.addEventListener('mouseover', mouseOverEsKlar);
    EsKlar.addEventListener('mouseout', mouseOutEsKlar);
    BKlar.addEventListener('mouseover', mouseOverBKlar);
    BKlar.addEventListener('mouseout', mouseOutBKlar);
    AKlar.addEventListener('mouseover', mouseOverAKlar);
    AKlar.addEventListener('mouseout', mouseOutAKlar);
}

function EsKlaran() {
    EsKlar.classList.remove("an");
    EsKlar.classList.add("fuchsia");
}
function EsKlaraus() {
    EsKlar.classList.remove("fuchsia");
    EsKlar.classList.remove("blur");
    EsKlar.classList.add("an");
}
function EsKlarblur() {
    EsKlar.classList.remove("an");
    EsKlar.classList.add("blur");
}
function BKlaran() {
    BKlar.classList.remove("an");
    BKlar.classList.add("fuchsia");
}
function BKlaraus() {
    BKlar.classList.remove("fuchsia");
    BKlar.classList.remove("blur");
    BKlar.classList.add("an");
}
function BKlarblur() {
    BKlar.classList.remove("an");
    BKlar.classList.add("blur");
}   
function AKlaran() {
    AKlar.classList.add("fuchsia");
    AKlar.classList.remove("an");
}
function AKlaraus() {
    AKlar.classList.remove("fuchsia");
    AKlar.classList.remove("blur");
    AKlar.classList.add("an");
}
function AKlarblur() {
    AKlar.classList.remove("an");
    AKlar.classList.add("blur");
}

function Klangan() {
    Klang.classList.remove("aus");
    Klang.classList.add("an");
}
function Klangaus() {
    Klang.classList.remove("an");
    Klang.classList.add("aus");
}
function Klang_Can() {
    Klang_C.classList.remove("aus");
    Klang_C.classList.add("an");
}
function Klang_Caus() {
    Klang_C.classList.remove("an");
    Klang_C.classList.add("aus");
}

function c1an() {
    c1.classList.remove("aus");
    c1.classList.add("an");
}
function c1aus() {
    c1.classList.remove("an");
    c1.classList.add("aus");
}
function es1an() {
    es1.classList.remove("aus");
    es1.classList.add("an");
}
function es1aus() {
    es1.classList.remove("an");
    es1.classList.add("aus");
}
function kleinesBan() {
    kleinesB.classList.remove("aus");
    kleinesB.classList.add("an");
}
function kleinesBaus() {
    kleinesB.classList.remove("an");
    kleinesB.classList.add("aus");
}
function kleinesAan() {
    kleinesA.classList.remove("aus");
    kleinesA.classList.add("an");
}
function kleinesAaus() {
    kleinesA.classList.remove("an");
    kleinesA.classList.add("aus");
}

addEventListeners()

function mouseOverEsKlar() {
    Klang_Caus();
    Klangan();
    BKlarblur();
    AKlarblur();
    c1aus();
    EsKlaran();
    es1an();
}
function mouseOutEsKlar() {
    Klangaus();
    Klang_Can();
    BKlaraus();
    AKlaraus();
    c1an();
    EsKlaraus();
    es1aus();
}

function mouseOverBKlar() {
    Klang_Caus();
    Klangan();
    EsKlarblur();
    AKlarblur();
    c1aus();
    BKlaran();
    kleinesBan();
}
function mouseOutBKlar() {
    Klangaus();
    Klang_Can();
    EsKlaraus();
    AKlaraus();
    c1an();
    BKlaraus();
    kleinesBaus();
    }

function mouseOverAKlar() {
    Klang_Caus();
    Klangan();
    EsKlarblur();
    BKlarblur();
    c1aus();
    AKlaran();
    kleinesAan();
}
function mouseOutAKlar() {
    Klangaus();
    Klang_Can();
    EsKlaraus();
    BKlaraus();
    c1an();
    AKlaraus();
    kleinesAaus();
    }
